import React, { useState } from 'react';
import { Box, VStack, HStack, Icon, Text, Spinner, Center, Alert, AlertIcon } from '@chakra-ui/react';
import { FiDatabase, FiUpload, FiFileText, FiBarChart2, FiLayers, FiPlayCircle, FiRefreshCw } from 'react-icons/fi';
import { useDropzone } from 'react-dropzone';
import { uploadFileForPrediction } from '../services/api.js'; // Ensure this function is correctly defined in your services

const SidebarItem = ({ icon, label }) => (
  <HStack
    spacing={3}
    p={3}
    borderRadius="md"
    _hover={{ backgroundColor: 'gray.100', cursor: 'pointer' }}
    width="full"
  >
    <Icon as={icon} boxSize={5} />
    <Text>{label}</Text>
  </HStack>
);

const CropDisease = () => {
  const [prediction, setPrediction] = useState(null);
  const [confidence, setConfidence] = useState(null);
  const [loading, setLoading] = useState(false);
  const [error, setError] = useState(null);

  const { getRootProps, getInputProps, isDragActive } = useDropzone({
    accept: 'image/*',
    onDrop: (acceptedFiles) => {
      const file = acceptedFiles[0];
      setLoading(true);
      setError(null);

      uploadFileForPrediction(file)
        .then((response) => {
          const { prediction, confidence } = response.data;
          setPrediction(prediction);
          setConfidence(confidence);
        })
        .catch((error) => {
          setError('Error uploading the file or receiving the prediction.');
          console.error('Error details:', error.response ? error.response.data : error.message);
        })
        .finally(() => {
          setLoading(false);
        });
    }
  });

  return (
    <Box display="flex" minHeight="100vh">
      {/* Sidebar */}
      <Box
        as="nav"
        bg="white"
        w="350px"
        borderRight="1px solid #ddd"
        p={4}
        zIndex="1000"
        height="100vh"
      >
        <VStack align="flex-start" spacing={4}>
          <SidebarItem icon={FiDatabase} label="Crop Disease Classification" />
          <SidebarItem icon={FiUpload} label="Upload Data" />
          <SidebarItem icon={FiFileText} label="Annotate" />
          <SidebarItem icon={FiBarChart2} label="Dataset" />
          <SidebarItem icon={FiLayers} label="Analytics" />
        </VStack>
      </Box>

      {/* Main Content */}
      <Box flex="1" p={6}>
        <Center>
          <Box
            {...getRootProps()}
            border="2px dashed"
            borderColor={isDragActive ? 'blue.500' : 'gray.300'}
            p={6}
            borderRadius="md"
            width="full"
            textAlign="center"
          >
            <input {...getInputProps()} />
            {loading ? (
              <Spinner size="xl" />
            ) : (
              <Text>
                {isDragActive ? 'Drop the file here...' : 'Drag & drop an image here, or click to select one'}
              </Text>
            )}
          </Box>
        </Center>
        {error && (
          <Center mt={4}>
            <Alert status="error">
              <AlertIcon />
              {error}
            </Alert>
          </Center>
        )}
        {prediction && (
          <Box mt={6}>
            <Text fontSize="lg" fontWeight="bold">Prediction: {prediction}</Text>
            <Text fontSize="md">Confidence: {confidence.toFixed(2)}</Text>
          </Box>
        )}
      </Box>
    </Box>
  );
};

export default CropDisease;
